import photo from "./react.png"
export default function Header() {
    return (
      <header>
        <nav>
        <img src={photo} width="40px"></img>
          <ul className="nav-items">
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>

      </header>
    );
  }
